import React, { Component } from "react";

export default class ProductList extends Component {
  render() {
    let products = this.props.products;
    return (
      <div id="product-list">
        <header>
          <strong>Product List (0 items)</strong>
        </header>
        <table>
          <thead>
            <tr>
              <th>ID</th>
              <th>Name</th>
              <th>Department</th>
              <th>Price</th>
            </tr>
          </thead>
          <tbody>
            {/* Display products here in new table rows */}
            {products.map(function ({ id, name, department, price }) {
              return (
                <tr key={id}>
                  <td>{id}</td>
                  <td>{name}</td>
                  <td>{department}</td>
                  <td>{price}</td>
                </tr>
              );
            })}
          </tbody>
        </table>
      </div>
    );
  }
}
